INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 2, 0.0, "2030/12/17 14:59:59", 2, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 401, 10046, 102301, 24001, 0.0, "2020/07/31 12:00:00", 0.0, "アヤネ");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 1, 2.21, "2030/12/17 14:59:59", 2, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 402, 10046, 102301, 24002, 0.0, "2020/07/31 12:00:00", 0.0, "アヤネ");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 2, 0.0, "2030/12/17 14:59:59", 2, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 403, 10046, 102301, 24003, 0.0, "2020/07/31 12:00:00", 0.0, "アヤネ");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 2, 1.99, "2030/12/17 14:59:59", 1, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 701, 10046, 192201, 24004, 0.0, "2020/07/31 12:00:00", 0.0, "アサヒ");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 1, 2.21, "2030/12/17 14:59:59", 2, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 702, 10046, 192201, 24005, 0.0, "2020/07/31 12:00:00", 0.0, "アサヒ");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 2, 3.33, "2030/12/17 14:59:59", 1, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 703, 10046, 192201, 24006, 0.0, "2020/07/31 12:00:00", 0.0, "アサヒ");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 2, 0.0, "2030/12/17 14:59:59", 2, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 801, 10046, 192301, 24007, 0.0, "2020/07/31 12:00:00", 0.0, "部員３");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 1, 2.68, "2030/12/17 14:59:59", 2, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 802, 10046, 192301, 24008, 0.0, "2020/07/31 12:00:00", 0.0, "部員３");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 2, 0.0, "2030/12/17 14:59:59", 2, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 803, 10046, 192301, 24009, 0.0, "2020/07/31 12:00:00", 0.0, "部員３");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 1, 0.0, "2030/12/17 14:59:59", 1, "やった！", 501, 10046, 192501, 24010, 0.0, "2020/07/31 12:00:00", 0.0, "");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 1, 0.0, "2030/12/17 14:59:59", 1, "勝ったよ！", 502, 10046, 192501, 24011, 0.0, "2020/07/31 12:00:00", 0.0, "");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 1, 0.0, "2030/12/17 14:59:59", 1, "いい調子！", 503, 10046, 192501, 24012, 0.0, "2020/07/31 12:00:00", 0.0, "");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 6, 5.33, "2030/12/17 14:59:59", 2, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 111, 10046, 113501, 24013, 0.0, "2020/07/31 12:00:00", 0.0, "ミサト");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 1, 6.85, "2030/12/17 14:59:59", 2, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 112, 10046, 113501, 24014, 0.0, "2020/07/31 12:00:00", 0.0, "ミサト");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 1, 3.0, "2030/12/17 14:59:59", 2, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 113, 10046, 113501, 24015, 0.0, "2020/07/31 12:00:00", 0.0, "ミサト");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 1, 6.11, "2030/12/17 14:59:59", 2, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 611, 10046, 192401, 24016, 0.0, "2020/07/31 12:00:00", 0.0, "ダイチ");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 1, 6.75, "2030/12/17 14:59:59", 2, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 612, 10046, 192401, 24017, 0.0, "2020/07/31 12:00:00", 0.0, "ダイチ");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 2, 0.0, "2030/12/17 14:59:59", 2, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 613, 10046, 192401, 24018, 0.0, "2020/07/31 12:00:00", 0.0, "ダイチ");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 2, 4.52, "2030/12/17 14:59:59", 1, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 211, 10046, 113401, 24019, 0.0, "2020/07/31 12:00:00", 0.0, "ハツネ");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 2, 3.89, "2030/12/17 14:59:59", 1, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 212, 10046, 113401, 24020, 0.0, "2020/07/31 12:00:00", 0.0, "ハツネ");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 1, 13.49, "2030/12/17 14:59:59", 2, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 213, 10046, 113401, 24021, 0.0, "2020/07/31 12:00:00", 0.0, "ハツネ");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 1, 3.17, "2030/12/17 14:59:59", 2, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 311, 10046, 106501, 24022, 0.0, "2020/07/31 12:00:00", 0.0, "カヤ");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 1, 4.42, "2030/12/17 14:59:59", 2, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 312, 10046, 106501, 24023, 0.0, "2020/07/31 12:00:00", 0.0, "カヤ");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 6, 2.89, "2030/12/17 14:59:59", 1, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 313, 10046, 106501, 24024, 0.0, "2020/07/31 12:00:00", 0.0, "カヤ");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 4, 3.71, "2030/12/17 14:59:59", 3, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 421, 10046, 102301, 24025, 0.0, "2020/07/31 12:00:00", 0.0, "アヤネ");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 2, 5.1, "2030/12/17 14:59:59", 1, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 721, 10046, 192201, 24026, 0.0, "2020/07/31 12:00:00", 0.0, "アサヒ");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 1, 4.34, "2030/12/17 14:59:59", 3, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 821, 10046, 192301, 24027, 0.0, "2020/07/31 12:00:00", 0.0, "部員３");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 1, 0.0, "2030/12/17 14:59:59", 1, "いい勝負だったよ\nまたやろうね", 521, 10046, 192501, 24028, 0.0, "2020/07/31 12:00:00", 0.0, "");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 1, 5.62, "2030/12/17 14:59:59", 2, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 101, 10046, 113501, 24029, -360.0, "2020/07/31 12:00:00", 0.0, "ミサト");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 1, 9.58, "2030/12/17 14:59:59", 2, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 102, 10046, 113501, 24030, -360.0, "2020/07/31 12:00:00", 0.0, "ミサト");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 2, 0.0, "2030/12/17 14:59:59", 2, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 103, 10046, 113501, 24031, -360.0, "2020/07/31 12:00:00", 0.0, "ミサト");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 2, 9.13, "2030/12/17 14:59:59", 1, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 104, 10046, 113501, 24032, -360.0, "2020/07/31 12:00:00", 0.0, "ミサト");
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (24, 1, 8.27, "2030/12/17 14:59:59", 2, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 105, 10046, 113501, 24033, -360.0, "2020/07/31 12:00:00", 0.0, "ミサト");
